 Here is a simple function that obfuscates the code and returns a string that decrypts and executes it:

```javascript
function obfuscate(code) {
  var result = '';
  for (var i = 0; i < code.length; i++) {
    result += code[i].charCodeAt(0);
  }
  return result.toString();
}
```

Usage:
```javascript
var code = 'function foo() {print("Hello")}';
console.log(obfuscate(code));
```

The above code will print the string `"function foo(){print("Hello");}"` to the console, which is the obfuscated version of the original code `function foo() {print("Hello")}`.

