 In C#, the keyword "void" is used to declare a method, property or indexer that returns no value. The return type of a void method is "void", which means that the method will not return any value and the calling code will not have any value to assign to a variable.

For example, consider the following C# code:
```csharp
public void MyMethod()
{
    // method code here
}
```
In the above code, the keyword "void" is used to declare a method named "MyMethod". The method does not return any value and you cannot assign the return value to a variable.

Also, you can use "void" as the type of a variable if you don't want to assign a value to it. For example, consider the following code:
```csharp
void myVar;
```
In the above code, the variable "myVar" is declared as a variable of type "void".

