def hungarian(matrix, matching):
    """
    given the matrix of values, capable of generating a matching.

    Parameters:
    matrix: A matrix where the rows represent the rows to be matched, and the columns are ordered by preference

    matching: A matching
    """
    for index, values in matrix.items():
        for value in values:
            if value not in matching:
                for row in values:
                    row[index] = False
    new_mapping = {}
    for row in matrix:
        for column in matrix:
            if row[column] and column not in new_mapping:
                new_mapping[column] = []
